import React, { Component } from 'react';
import './UserCard.css';

class UserCard extends Component {

  render () {
    return (
      <img src="https://images.pexels.com/photos/20787/pexels-photo.jpg?auto=compress&cs=tinysrgb&h=350"/>
    )
  }
}

export default UserCard;
